import React from 'react';
import './listPage.css';

const schools = () => {
    return(
    <div lassName="project-list section listBlock">
        <h4 className="headline">בחר בית ספר</h4>
        <Link to="/NewClass">
             <button className="btn">דנמרק</button>
             <button className="btn">זיו</button>
             <button className="btn">מכללת אורט</button>
             <button className="btn">הגמנסיה העברית</button>
             <button className="btn">גבעת גונן</button>
        </Link>
    </div>

    )
}

export default schools;
